import ProductItem from "./ProductItem";

const ProductList = (props) => {
  const { products } = props;
  // if(product.length === 0){
  //     return (<h2>No Product found.</h2>);
  // }
  return (
    <div className="card-group col-md-3 col">
      {products.map((product) => (
        <ProductItem
          key={product.id}
          name={product.name}
          price={product.price}
          date={product.date}
          brand={product.brand}
          color={product.color}
          size={product.size}
          description={product.description}
          image={product.image}
          category={product.category}
        />
      ))}
    </div>
  );
};

export default ProductList;
